INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:38:51.990588+00', 'bc122947-b507-4526-91c6-78014f463d51', 'ffba2c14-4170-48da-bec3-ab5fd4ec9a3f', '2025-10-05 10:38:33+00', 'START', 'sql', '{"sql": {"query": "INSERT INTO orders_7_days (order_id, placed_on, discount_id, restaurant_id, menu_id, menu_item_id, category_id)\n SELECT o.id AS order_id, o.placed_on, o.discount_id, m.restaurant_id, m.id AS menu_id, mi.id AS menu_item_id, c.id AS category_id\n   FROM orders AS o\n  INNER JOIN menu_items AS mi\n     ON menu_items.id = o.menu_item_id\n  INNER JOIN categories AS c\n     ON c.id = mi.category_id\n  INNER JOIN menus AS m\n     ON m.id = c.menu_id\n  WHERE o.placed_on >= NOW() - interval ''7 days'';", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}}', '4644dbc7-c47c-4ae7-9a0f-a999b36a2b49');
