INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:38:58.979779+00', 'f2ec21eb-c33d-4dcb-86e4-9adaa3eeb4eb', 'b7098939-87f0-4207-878f-dfd8e8804d8a', '2025-10-05 10:38:33+00', 'START', 'sql', '{"sql": {"query": "INSERT INTO order_status (id, transitioned_at, status, order_id, customer_id, restaurant_id, driver_id)\n SELECT id, transitioned_at, status, order_id, customer_id, restaurant_id, driver_id\n   FROM tmp_order_status;", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}}', '45a22a4c-9481-4af2-a506-5d5c7717c2be');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:08.091938+00', '8222d4a8-1d3e-4fab-a4ef-009cab1cd35c', 'd5a2a4c4-fc78-428d-ae85-08c942ed8371', '2025-10-05 10:38:33+00', 'START', 'documentation', '{"documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Loads new deliveries for the week."}}', 'b59de3b6-ee0d-43e9-bf6d-cd0f675fbe62');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:08.091938+00', '8222d4a8-1d3e-4fab-a4ef-009cab1cd35c', 'd5a2a4c4-fc78-428d-ae85-08c942ed8371', '2025-10-05 10:38:33+00', 'START', 'sql', '{"sql": {"query": "INSERT INTO delivery_7_days (order_id, order_placed_on, order_dispatched_on, order_delivered_on, customer_email,\n      customer_address, discount_id, menu_id, restaurant_id, restaurant_address, menu_item_id, category_id, driver_id)\n  SELECT o.order_id, o.placed_on AS order_placed_on,\n    (SELECT transitioned_at FROM order_status WHERE order_id == o.order_id AND status = ''DISPATCHED'') AS order_dispatched_on,\n    (SELECT transitioned_at FROM order_status WHERE order_id == o.order_id AND status = ''DELIVERED'') AS order_delivered_on,\n    c.email AS customer_email, c.address AS customer_address, o.discount_id, o.menu_id, o.restaurant_id,\n      r.address, o.menu_item_id, o.category_id, d.id AS driver_id\n    FROM orders_7_days AS o\n   INNER JOIN order_status AS os\n      ON os.order_id = o.order_id\n   INNER JOIN customers AS c\n      ON c.id = os.customer_id\n   INNER JOIN restaurants AS r\n      ON r.id = os.restaurant_id\n   INNER JOIN drivers AS d\n      ON d.id = os.driver_id\n   WHERE os.transitioned_at >= NOW() - interval ''7 days'';", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}}', 'b59de3b6-ee0d-43e9-bf6d-cd0f675fbe62');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:12.972846+00', '3c1c7bea-84e7-4653-b1ac-1fcfe0f27756', 'bd41a42a-bf18-4b74-9bb7-cd62637823d8', '2025-10-05 10:38:33+00', 'START', 'documentation', '{"documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Determine weekly top delivery times by restaurant."}}', '18f99691-58f2-4260-8b66-1d1b4be84123');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:15.482749+00', '6dfdadf3-2908-4f2f-a497-ba32893e038d', 'adc8507c-595e-4d76-9dac-be2bf0ffe1ee', '2025-10-05 10:38:33+00', 'START', 'documentation', '{"documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Determines the popular day of week orders are placed."}}', '2599b373-176b-400c-b613-daff1bf33d3a');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:15.482749+00', '6dfdadf3-2908-4f2f-a497-ba32893e038d', 'adc8507c-595e-4d76-9dac-be2bf0ffe1ee', '2025-10-05 10:38:33+00', 'START', 'sql', '{"sql": {"query": "INSERT INTO popular_orders_day_of_week (order_day_of_week, order_placed_on, orders_placed)\n  SELECT EXTRACT(DOW FROM t.order_placed_on) AS order_day_of_week, t.order_placed_on, COUNT(*) AS orders_placed\n    FROM top_delivery_times AS t\n   INNER JOIN customers AS c\n      ON d.customer_email = c.email\n   GROUP BY t.order_day_of_week\n   ORDER BY t.orders_placed DESC\n   LIMIT 1;", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}}', '2599b373-176b-400c-b613-daff1bf33d3a');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:12.972846+00', '3c1c7bea-84e7-4653-b1ac-1fcfe0f27756', 'bd41a42a-bf18-4b74-9bb7-cd62637823d8', '2025-10-05 10:38:33+00', 'START', 'sql', '{"sql": {"query": "INSERT INTO top_delivery_times (order_id, order_placed_on, order_delivered_on, order_delivery_time,\n      customer_email, restaurant_id, driver_id)\n  SELECT order_id, order_placed_on, order_delivered_on, DATEDIFF(minute, order_placed_on, order_delivered_on) AS order_delivery_time,\n    customer_email, restaurant_id, driver_id\n    FROM delivery_7_days\n   GROUP BY restaurant_id\n   ORDER BY order_delivery_time DESC\n   LIMIT 1;\nINSERT INTO discounts (amount_off, customer_email, starts_on, ends_on)\n  SELECT customer_email, DATEDIFF(minute, order_placed_on, order_delivered_on) AS order_delivery_time,\n    CASE WHEN order_delivery_time >= 60 THEN 15\n      ELSE 5\n    END AS amount_off,\n    NOW() AS starts_on,\n    NOW() + interval ''7 days'' AS ends_on\n   FROM top_delivery_times\n  WHERE order_delivery_time >= 45;", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}}', '18f99691-58f2-4260-8b66-1d1b4be84123');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:18.677619+00', 'e5ec1548-036d-48a0-88d7-af1cce96e82f', '3ab25429-cf9c-4d1d-9166-1e1946f9d3c3', '2025-10-05 10:38:33+00', 'START', 'documentation', '{"documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Email discounts to customers that have experienced order delays."}}', '8ff95d0e-b63d-40bb-bc1b-d0e5b505ae17');
INSERT INTO public.job_facets (created_at, job_uuid, run_uuid, lineage_event_time, lineage_event_type, name, facet, job_version_uuid) VALUES ('2025-10-05 10:39:18.677619+00', 'e5ec1548-036d-48a0-88d7-af1cce96e82f', '3ab25429-cf9c-4d1d-9166-1e1946f9d3c3', '2025-10-05 10:38:33+00', 'START', 'sql', '{"sql": {"query": "SELECT d.id, d.amount_off, d.customer_email, d.starts_on, d.ends_on\n  FROM discounts AS d\n INNER JOIN customers AS c\n    ON d.customer_email = c.email;", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}}', '8ff95d0e-b63d-40bb-bc1b-d0e5b505ae17');
