INSERT INTO public.lineage_events (event_time, event, event_type, job_name, job_namespace, producer, run_uuid, created_at, _event_type) VALUES ('2025-10-05 10:38:33+00', '{"job": {"name": "delivery_times_7_days", "facets": {"sql": {"query": "INSERT INTO top_delivery_times (order_id, order_placed_on, order_delivered_on, order_delivery_time,\n      customer_email, restaurant_id, driver_id)\n  SELECT order_id, order_placed_on, order_delivered_on, DATEDIFF(minute, order_placed_on, order_delivered_on) AS order_delivery_time,\n    customer_email, restaurant_id, driver_id\n    FROM delivery_7_days\n   GROUP BY restaurant_id\n   ORDER BY order_delivery_time DESC\n   LIMIT 1;\nINSERT INTO discounts (amount_off, customer_email, starts_on, ends_on)\n  SELECT customer_email, DATEDIFF(minute, order_placed_on, order_delivered_on) AS order_delivery_time,\n    CASE WHEN order_delivery_time >= 60 THEN 15\n      ELSE 5\n    END AS amount_off,\n    NOW() AS starts_on,\n    NOW() + interval ''7 days'' AS ends_on\n   FROM top_delivery_times\n  WHERE order_delivery_time >= 45;", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}, "documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Determine weekly top delivery times by restaurant."}}, "namespace": "food_delivery"}, "run": {"runId": "bd41a42a-bf18-4b74-9bb7-cd62637823d8", "facets": {"nominalTime": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/NominalTimeRunFacet.json", "nominalEndTime": "2020-02-22T22:00:00Z", "nominalStartTime": "2020-02-22T22:00:00Z"}}}, "inputs": [{"name": "public.delivery_7_days", "namespace": "food_delivery"}], "outputs": [{"name": "public.top_delivery_ti