INSERT INTO public.lineage_events (event_time, event, event_type, job_name, job_namespace, producer, run_uuid, created_at, _event_type) VALUES ('2025-10-05 10:38:33+00', '{"job": {"name": "orders_popular_day_of_week", "facets": {"sql": {"query": "INSERT INTO popular_orders_day_of_week (order_day_of_week, order_placed_on, orders_placed)\n  SELECT EXTRACT(DOW FROM t.order_placed_on) AS order_day_of_week, t.order_placed_on, COUNT(*) AS orders_placed\n    FROM top_delivery_times AS t\n   INNER JOIN customers AS c\n      ON d.customer_email = c.email\n   GROUP BY t.order_day_of_week\n   ORDER BY t.orders_placed DESC\n   LIMIT 1;", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}, "documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Determines the popular day of week orders are placed."}}, "namespace": "food_delivery"}, "run": {"runId": "adc8507c-595e-4d76-9dac-be2bf0ffe1ee", "facets": {"nominalTime": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/NominalTimeRunFacet.json", "nominalEndTime": "2020-02-22T22:00:00Z", "nominalStartTime": "2020-02-22T22:00:00Z"}}}, "inputs": [{"name": "public.top_delivery_times", "namespace": "food_delivery"}, {"name": "public.customers", "namespace": "food_delivery"}], "outputs": [{"name": "public.popular_orders_day_of_week", "facets": {"schema": {"fields": [{"name": "order_day_of_week", "type": "INTEGER", "description": "The day of week of the order."}, {"name": "order_placed_on", "type": "TIMESTAMP", "description": "An ISO-8601 timestamp representing the date/time the order was placed."}, {"name": "orders_placed", "type": "INTEGER", "description": "The number of orders placed o