INSERT INTO public.lineage_events (event_time, event, event_type, job_name, job_namespace, producer, run_uuid, created_at, _event_type) VALUES ('2025-10-05 10:38:33+00', '{"job": {"name": "etl_orders_7_days", "facets": {"sql": {"query": "INSERT INTO orders_7_days (order_id, placed_on, discount_id, restaurant_id, menu_id, menu_item_id, category_id)\n SELECT o.id AS order_id, o.placed_on, o.discount_id, m.restaurant_id, m.id AS menu_id, mi.id AS menu_item_id, c.id AS category_id\n   FROM orders AS o\n  INNER JOIN menu_items AS mi\n     ON menu_items.id = o.menu_item_id\n  INNER JOIN categories AS c\n     ON c.id = mi.category_id\n  INNER JOIN menus AS m\n     ON m.id = c.menu_id\n  WHERE o.placed_on >= NOW() - interval ''7 days'';", "_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/SQLJobFacet.json"}, "documentation": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/DocumentationJobFacet.json", "description": "Loads newly placed orders weekly."}}, "namespace": "food_delivery"}, "run": {"runId": "ffba2c14-4170-48da-bec3-ab5fd4ec9a3f", "facets": {"nominalTime": {"_producer": "https://github.com/MarquezProject/marquez/blob/main/docker/metadata.json", "_schemaURL": "https://openlineage.io/spec/facets/1-0-0/NominalTimeRunFacet.json", "nominalEndTime": "2020-02-22T22:00:00Z", "nominalStartTime": "2020-02-22T22:00:00Z"}}}, "inputs": [{"name": "public.menus", "namespace": "food_delivery"}, {"name": "public.menu_items", "namespace": "food_delivery"}, {"name": "public.orders", "namespace": "food_delivery"}, {"name": "public.categories", "namespace": "food_delivery"}], "outputs": [{"name": "public.orders_7_days", "facets": {"schema": {"fields": [{"name": "order_id", "type": "INTEGER", "description": "The ID of the order."}, {"name": "placed_on", "type": "TIMESTAMP", "description": "An ISO-8